import React from 'react';
import SpotifyPlaylistButtons from './SpotifyPlaylistButtons';

const compo = () => {
  const playlists = [
    { id: 1, name: 'Playlist 1', externalUrl: 'https://example.com/playlist1' },
    { id: 2, name: 'Playlist 2', externalUrl: 'https://example.com/playlist2' },
    // Agrega más playlists según tus necesidades
  ];

  return (
    <div>
      <h1>Playlists de Spotify</h1>
      <SpotifyPlaylistButtons playlists={playlists} />
    </div>
  );
};

export default compo;
